import React from "react";
import { Routes, Route, Link, Navigate } from "react-router-dom";

const Home = ({ user }) => {
    if (!user) {
        return <Navigate to="/Login" replace />;
    }

    return (
        <div className="home">
            <div className="container">
                <h1>Home</h1>
            </div>
        </div>
    );
};

export default Home;
